import com.oracle.tools.packager.IOUtils;
import com.sun.org.apache.xerces.internal.impl.dv.util.Base64;
import java.io.*;
import java.net.URLConnection;
import java.util.Properties;

public class Test {
    public static void main(String[] args) {
        try {
            new Test().test();
        } catch (FileNotFoundException e) {
            e.printStackTrace();
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

    public void test() throws IOException {
        //Decode the Base64 encoded string into byte array
        // tokenize the data since the 64 encoded data look like this "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAoAAAAKAC"
        //String base64ImageString = "data:image/jpeg;base64,";

        InputStream input = new FileInputStream("src/resources/config.properties");
        Properties prop = new Properties();
        prop.load(input);
        String base64ImageString = prop.getProperty("base64Image");

        String delims="base64,";
        String[] parts = base64ImageString.split(delims);
        String imageString = parts[1];
        byte[] imageByteArray = Base64.decode(imageString );

        InputStream is = new ByteArrayInputStream(imageByteArray);

        //Find out image type
        String mimeType = null;
        String fileExtension = null;
        try {
            mimeType = URLConnection.guessContentTypeFromStream(is); //mimeType is something like "image/jpeg"
            String delimiter="[/]";
            String[] tokens = mimeType.split(delimiter);
            fileExtension = tokens[1];
        } catch (IOException ioException){

        }

        System.out.println("fileExtension=>"+ fileExtension);

    }

}
